            beta = random.gauss(0.7,0.1);       #Generamos un numero de gauss de media=0.7 y desviacion = 0.1;

            padres[0] = mejores[i];
            padres[1] = mejores[i+1];
            padres[2] = mejores[i+2];

            [padres,indices_padres] = sort.sort(padres,[0,1,2]);

